tables.table_schema:
CREATE TABLE photography_competition_entries (
    contestant_id INT PRIMARY KEY,
    contestant_name VARCHAR(255) NOT NULL,
    photo_submission BLOB NOT NULL,
    judging_score INT
);

CREATE TABLE judging_panels (
    panel_id INT PRIMARY KEY,
    panel_name VARCHAR(255) NOT NULL,
    panel_description TEXT
);

CREATE TABLE judging_panel (
    judge_id INT PRIMARY KEY,
    judge_name TEXT,
    expertise_area TEXT
);

CREATE TABLE competition_entries (
    entry_id INT PRIMARY KEY,
    contestant_id INT,
    photo_submission TEXT,
    judging_score FLOAT
);

CREATE TABLE contestants (
    contestant_id INT PRIMARY KEY,
    contestant_name VARCHAR(50),
    email VARCHAR(255)
);

CREATE TABLE judges (
    judge_id INT PRIMARY KEY,
    judge_name VARCHAR(50),
    specialization VARCHAR(50)
);

CREATE TABLE competitions (
    competition_id INT PRIMARY KEY,
    competition_name VARCHAR(50),
    competition_year INT
);

CREATE TABLE judging_panel (
  judge_id UUID PRIMARY KEY,
  judge_name VARCHAR(50),
  expertise_area VARCHAR(50)
);

CREATE TABLE contest_categories (
  category_id UUID PRIMARY KEY,
  category_name VARCHAR(50),
  description TEXT
);

CREATE TABLE contest_stats (
  category_id UUID,
  total_entries INT,
  avg_score FLOAT,
  PRIMARY KEY (category_id)
);
